      this.setState({
        isUserLoggedIn: status
      })

  }

  render() {
    return(
      <React.Fragment>
      <NavigationBar />

      {console.log('A Test of grabbing user status', this.state.isUserLoggedIn)}
       <Login getUserStatus={(e) => this.getUserStatus(e)} />
      <MapComponent userstatus={this.state.isUserLoggedIn} />

      <Layout>
        <Home />
      </Layout>
      <Signup />
        {console.log('A Test of grabbing user status', this.state.isUserLoggedIn)}
      </React.Fragment>
      );
  }
}
